import React, { Component } from "react";
import { connect } from "react-redux";
import Dialog from "./Dialog";
import Footer from "./Footer";
import * as actions from "../actions/queries";

class Dashboard extends Component {
  constructor() {
    super();

    this.state = {
      isLoading: false
    };
  }
  componentWillMount() {
    var inteval = setInterval(() => {
      this.props.getMembers(this.props.profile.id);
    }, 4000);
  }

  render() {
    return (
      <div>
        <div style={{ textAlign: "center" }} className="profile  card ">
          <h3>Profile </h3>
          <hr />
          <div>
            {" "}
            <label>name </label> <h6> {this.props.profile.name} </h6>
          </div>
          <div>
            <label>refs </label> <h6> {this.props.profile.refNumber} </h6>
          </div>
        </div>

        <h4 style={{ textAlign: "center" }} className="primary">
          {" "}
          {this.props.memberCount} active memebers
        </h4>
        <Dialog />
        <Footer />
      </div>
    );
  }
}

Dashboard.propTypes = {};

function mapDispatchToProps(dispatch) {
  return {
    getMembers: data => dispatch(actions.getMembers(data))
  };
}

function mapStateToProps(state) {
  return {
    profile: state.user.profile,
    memberCount: state.user.memberCount
  };
}

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(Dashboard);
